import React from 'react';
import "./style.css";
const avbar = () => {
  return (
    <nav>
      <div className="logo">
        <img src="logo.png" alt="My App Logo" />
        <h1>My App</h1>
      </div>
      <ul className="nav-links">
        <li><a href="#">Home</a></li>
        <li><a href="#">About</a></li>
        <li><a href="#">Contact</a></li>
      </ul>
    </nav>
  );
};

export default navbar;
